import React from "react";
import { Button, Container, Row } from 'react-bootstrap';
import logo from '../../assest/Logo.png'
import './header.css'
import { IconName, IoIosAirplane, IoIosCall, IoLogoFacebook, IoLogoWhatsapp, IoLogoTwitter } from "react-icons/io";

const Header = () => {
    return (
        <Container fluid >
            <div className="header_section" >
                <img src={logo} className="logoDisplay" style={{ width: '125px' }} />
                <div  className="header_sub_section">
                    <p className="side_intro" style={{marginRight: "40px"}}> Have any question?<br /><span><IoIosCall size={25} /></span> +12 365 5233  </p>
                    <p className="side_intro"> Want to contact us?<br /><span><IoLogoFacebook size={25} /></span> <span><IoLogoWhatsapp size={25} /></span> <span><IoLogoTwitter size={25} /></span>  </p>

                </div>

            </div>

            <hr style={{ color: "#c1c1c1" , padding:"0% 4%" }}></hr>

        </Container>
    );
}

export default Header;
